import React from 'react';
import './Footer.scss';

const Footer = () => {
	return (
		<div className="footer">
			<div className="border-line">
				<div className="footer-tab">Made by</div>
				<div className="footer-text">Frontend-최경주</div>
				<div className="footer-text">Backend-이동섭</div>
			</div>
		</div>
	);
};

export default Footer;
